summary:
* This translator app support all major languages like Czech,Danish, Dutch, English, Estonian, Finnish, French, German, Greek, Hebrew, Haitian Creole, Hungarian, Indonesian, Italian, Japanese, Korean, Lithuanian, Latvian and more..,

* Use this translator you can convert the following types of text:
General;
scientific;
technical;
commercial;
literary;
legal;
educational etc..,


* This Translator app is auto detecting the source language. So no need to set the explicit source language.

* We are translate your text using Bing Translator, so this is very fast and accurate.

* This application not running in the back-ground, so you can save the battery.

* We respect your privacy! we are not saving your information in any where.

Let’s face it, nobody likes moles. 
That’s why TapTop is so cool, you can shoot at moles as much as you want without having to stop!

Enjoy 4 different types of moles [-two different classical moles that give you 5 points each;
-one football mole that gives you 15 points but that you have to shoot twice;
-one blind mole that makes you lose 8 points;
-a master-time mole that gives you 5 seconds of bonus time!
(next updates should bring other awesome moles!)], and, if you’re really crazy, try to beat our best score: 1142 points!

Good game and Good luck ;-)


